import { useEffect, useState } from "react";
import "./index.css"

function EmpList(){
    const [data,setData]=useState(null)
    useEffect(()=>{
        fetch("https://jsonm/posts")
        // fetch("https://reqres.in/api/users")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp)
        })
    })
    return(
        <div className="container">
            <h1>Fetch data from backend</h1>
            <div className="card">
             <table >
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>City</th>
                        <th>Mobile</th>
                    </tr>
                </thead> 
                <tbody> 
                {data && data.map((item)=>(
                    <tr>
                        <td>{item.id}</td>
                        <td>{item.name}</td>
                        <td>{item.city}</td>
                        <td>{item.mobile}</td>
                    </tr> 
                     ))}
                </tbody>
             </table>
             </div>
        </div>
    )
}
export default EmpList;
